Superman v2 #35:
Featuring the art of legendary Superman artist Curt Swan! In this double feature, Brainiac and Lex Luthor return to plague the Man of Steel. Plus, Morgan Edge is paid a visit by the Black Racer of the New Gods.

Superman v2 #36:
The Prankster's back and unless the Man of Steel can get to the hospital on time, Morgan Edge may not survive the goofy villain's latest practical joke.

Superman v2 #37:
Superman attempts to help Jimmy Olsen with his altered genetic make-up problem, but his &quot;pal&quot; is having no part of it.

